import React from "react";
import Profile from "@mui/icons-material/AccountCircle";
import Search from "@mui/icons-material/Search";
import Home from "@mui/icons-material/Home";
import Movies from "@mui/icons-material/Movie";

function sidebar() {
  return (
    <div className="grid grid-cols-2 bg-black h-screen w-28">
      <div >
        <Home style={{ color: "white", fontSize: 40 }}/>
        <Movies style={{ color: "white", fontSize: 40 }}/>
        <Search  style={{ color: "white", fontSize: 40 }}/>
        <Profile  style={{ color: "white", fontSize: 40 }}/>
      </div>
    </div>
  );
}

export default sidebar;
